import React from 'react';
import Transaction from './Transaction';

const ListTransactions = () => {
    return (
        <div className='TransactionItemsList'>
            <h3>History</h3>
            <Transaction name="cash" />
            <Transaction name="t2" />
            <Transaction name="t3" />
            <Transaction name="t4" />
        </div>
    )
}


export default ListTransactions;
